$_MODULE['<{pm_advancedtopmenu}prestashop>pm_advancedtopmenu_047d6217b90e5036fc7e0b2ffb282da0'] = 'Si vous souhaitez vous abonner à la lettre d\'information, vous devez accepter le traitement des données à cette fin en cliquant sur le lien “envoyer”. Dans ce cas, les données seront traitées informatiquement (par envoi automatique) en vue d\'envoyer à l\'adresse de courrier électronique indiquée des informations sur nos logiciels, offres promotionnelles et informations de la société Presta Module. La communication des données à cette fin et le consentement correspondant sont absolument facultatifs et le refus n\'entraînera aucune conséquence autre que le fait de ne pas recevoir la lettre d\'information. Même après avoir accepté, vous pourrez de toute façon révoquer librement et gratuitement votre consentement à tout moment simplement en cliquant sur le lien de “désabonnement” présent dans toutes nos lettres d\'information, ou en écrivant à contact@presta-module.com. Les données ne seront pas communiquées à des tiers et elles seront traitées uniquement par du personnel préposé à cet effet (techniciens, opérateurs de marketing, préposés aux rapports avec la clientèle) si nécessaire.';
$_MODULE['<{pm_advancedtopmenu}prestashop>pm_advancedtopmenu_b5cc3e4cf479df2998beb573286269ca'] = 'Le Titulaire du traitement est la société Presta Module SARL, dont le siège social est 90 rue Stanislas Torrents 13006 Marseille, France.';
$_MODULE['<{pm_advancedtopmenu}prestashop>pm_advancedtopmenu_15a7db069c6257fc15e6c4c63a1680ba'] = 'Le Responsable du traitement est le Directeur des systèmes informatiques, domicilié aux fins de ces fonctions au siège social de la société indiqué. C\'est à lui que vous pouvez vous adresser pour l\'exercice, dans les délais et selon les modalités prévues par la loi, des droits visés par l\'extrait de l\'article 4 de la loi n°78-17 du 6 Janvier 1978, ainsi que pour obtenir la liste complète et mise à jour d\'autres responsables éventuels (toute communication doit être adressée \"A l\'attention du responsable du traitement des données\").';
